import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import './directory.style.scss';



class Directory extends React.Component{
    constructor () {
  super();
 
  this.state = {
      sections :[
          {
            title: 'HATS',
            imageSrc : '../../images',
            id:1,
            linkUrl: 'hats'
        },
      
        {
            title: 'JACKETS',
            imageSrc: '../../images/jackets/3.jpg',
            id:2,
            linkUrl: 'jackets'

        },

         {
            title: 'SNEAKERS',
            imageSrc : '../../images/shoes/2.jpg' ,
            id:3,
            linkUrl: ''
        },
         
        {
            title: 'MENs',
            imageSrc : '../../images/models/1' ,
            size:'large',
            id:4,
            linkUrl: ''
        },
         
         {
            title: 'WOMENs',
            imageSrc : '../../images/models/4',
            size:'large',
            id:5,
            linkUrl: ''
        }
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({ id, ...otherSectionProps}) => (
                <MenuItem key={id} {...otherSectionProps}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
